(5, '<div class="container"><!-- Example row of columns --><div class="row"><div class="col-md-4"><h2>Heading</h2><img border="0" class="img-fluid" src="https://cdn.pixabay.com/photo/2017/07/28/11/26/hand-2548398_960_720.jpg"> <!-- class="img-responsive" --><p>Donec id elit non mi porta gravida at eget metus. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Etiam porta sem malesuada magna mollis euismod. Donec sed odio dui.</p><p><a class="btn btn-secondary" href="#" role="button">View details »</a></p></div><div class="col-md-4"><h2>Heading</h2><img border="0" class="img-fluid" src="https://cdn.pixabay.com/photo/2012/12/20/10/12/michelangelo-71282_960_720.jpg"><p>Donec id elit non mi porta gravida at eget metus. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Etiam porta sem malesuada magna mollis euismod. Donec sed odio dui.</p><p><a class="btn btn-secondary" href="#" role="button">View details »</a></p></div><div class="col-md-4"><h2>Heading</h2><img border="0" class="img-fluid" src="https://cdn.pixabay.com/photo/2015/01/08/18/25/startup-593327_960_720.jpg"><p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p><p><a class="btn btn-secondary" href="#" role="button">View details »</a></p></div></div><!-- class=row --><hr></div><!-- /container -->', 'Bloque Tres Columnas', 'full_html'),
(6, '<section class="site-section border-bottom" id="team-section"><div class="container"><div class="row mb-5 justify-content-center"><div class="col-md-8 text-center"><h2 class="section-title mb-3" data-aos="fade-up" data-aos-delay="">Meet Team</h2><p class="lead" data-aos="fade-up" data-aos-delay="100">A small river named Duden flows by their place and supplies it with the necessary regelialia.</p></div></div><div class="row"><div class="col-md-6 col-lg-4 mb-4" data-aos="fade-up" data-aos-delay=""><div class="team-member"><figure><ul class="social"><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li></ul><img alt="Image" class="img-fluid" src="images/person_1.jpg"></figure><div class="p-3"><h3>Kaiara Spencer</h3><span class="position">Accountant</span></div></div></div><div class="col-md-6 col-lg-4 mb-4" data-aos="fade-up" data-aos-delay="100"><div class="team-member"><figure><ul class="social"><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li></ul><img alt="Image" class="img-fluid" src="images/person_2.jpg"></figure><div class="p-3"><h3>Dave Simpson</h3><span class="position">Bank Teller</span></div></div></div><div class="col-md-6 col-lg-4 mb-4" data-aos="fade-up" data-aos-delay="200"><div class="team-member"><figure><ul class="social"><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li><li>&nbsp;</li></ul><img alt="Image" class="img-fluid" src="images/person_3.jpg"></figure><div class="p-3"><h3>Ben Thompson</h3><span class="position">Bank Teller</span></div></div></div></div></div></section>', 'Bloque Conoce al Equipo tres columnas', 'full_html');
